// Navbar.jsx
import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/Navbar.css'; // Impor file CSS untuk Navbar
import logo from './assets/logo-pacmail.jpg'; // Gantilah dengan path yang sesuai

const Navbar = () => {
  const handleLogout = () => {
    // Implementasikan logika logout di sini
    console.log('Logout logic goes here');
  };

  return (
    <nav className="navbar">
      <div className="navbar-left">
        <Link to="/mail" className="logo-container">
          <img src={logo} alt="PacMail Logo" className="logo" />
          <span className="brand">PacMail</span>
        </Link>
      </div>
      <div className="navbar-right">
        <button onClick={handleLogout}>Logout</button>
      </div>
    </nav>
  );
};

export default Navbar;
